import "./App.css";

function App() {
  return (
    <div class="middle">
      <div class="center">
        <h1>Welcome to Fam Reveal!</h1>
        <br></br>
        <div class="nes-container with-title is-centered">
          <p class="title">Welcome to Fam Reveal</p>
        </div>
      </div>
    </div>
  );
}

export default App;
